import React from 'react';
// import { Paper } from '@mui/material';
import { TextField } from '@mui/material';
import { Paper } from '@mui/material';

export default function InputField(props) {
  return (
    <Paper
      sx={{ marginTop: '10px' }}
      autoComplete="off"
      elevation={10}
      fullWidth
    >
      <TextField
        id="outlined-basic"
        variant="outlined"
        autoComplete="email"
        autoFocus
        style={{
          margin: 0,
          textAllign: 'centre',
          width: 'inherit',
          fontFamily: 'Montserrat',
        }}
        label={props.field}
      />
    </Paper>
  );
}
